import Button from 'react-bootstrap/Button';

function AddTask() {
    return (
      <div>
        <input
          type="text"
          placeholder={"Add new task ..."}
        />
        <Button as="input" type="button" value="ADD" />{' '}
      </div>
    );
  }
  
  export default AddTask;
